import React, { useState, useEffect } from 'react';
import { TextField, Button, Container, Typography, Grid, Select, MenuItem, InputLabel, FormControl } from '@mui/material';

const RegistrationForm = () => {
    const [formData, setFormData] = useState({
        nome_completo: '',
        sexo: '',
        email: '',
        celular: '',
    });

    const [showWelcomeMessage, setShowWelcomeMessage] = useState(true);

    useEffect(() => {
        // You can perform any necessary logic here when the component mounts
        // For example, you can check if the user is an admin and show the welcome message accordingly

        // For now, I'm assuming a simple condition to show the welcome message
        const isAdmin = true; // Replace this with your actual logic to determine if the user is an admin
        setShowWelcomeMessage(isAdmin);
    }, []);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            // Your existing form submission logic...
        } catch (error) {
            console.error('Error:', error);
            // Handle error
        }
    };

    return (
        <Container maxWidth="sm">
            {showWelcomeMessage && <Typography variant="h4">Bem vindo admin</Typography>}
            <form onSubmit={handleSubmit}>
                <Grid container spacing={2}>
                    {/* ... Your form fields ... */}
                </Grid>
                <Button type="submit" variant="contained" color="primary" style={{ marginTop: '20px' }}>
                    Cadastrar paciente
                </Button>
            </form>
        </Container>
    );
};

export default RegistrationForm;
